import passport from 'passport';
import { Strategy as LocalStrategy } from 'passport-local';
import { Strategy as BearerStrategy } from 'passport-http-bearer';
import { Strategy as JwtStrategy, ExtractJwt } from 'passport-jwt';
import { jwtSecret } from '../../config';
import { User } from '../../api/user/model'; 

passport.use('password', new LocalStrategy({
  usernameField: 'email',
  passwordField: 'password',
}, (email, password, done) => {
  User.findOne({ where: { email } }).then((user) => {
    if (!user) {
      return done(true, false, { message: 'Incorrect email or password.' });
    }

    return user.authenticate(password).then((valid) => {
      if (!valid) {
        return done(true, false, { message: 'Incorrect email or password.' });
      }

      return done(null, user);
    });
  }).catch((err) => done(err));
}));

passport.use('token', new JwtStrategy({
  secretOrKey: jwtSecret,
  jwtFromRequest: ExtractJwt.fromAuthHeaderWithScheme('Bearer'),
}, ({ id }, done) => {
  User.findByPk(id).then((user) => {
    if (!user) {
      return done(null, false);
    }

    return done(null, user);
  }).catch((err) => done(err));
}));

passport.use('master', new BearerStrategy((token, done) => {
  // Implement your master key validation logic here
  if (token === 'your-master-key') {
    return done(null, {});
  }

  return done(null, false);
}));

export const passwordAuth = () => passport.authenticate('password', { session: false });
export const tokenAuth = () => passport.authenticate('token', { session: false });
export const masterAuth = () => passport.authenticate('master', { session: false });

